package algoProblemSolutions.strings;

public class PalindromeIndex {

    public static void main(String[] args) {

        String s = "";
//        String s = "";

        System.out.println(s.length());
        System.out.println(palindromeIndex(s));

    }


    static int palindromeIndex(String s){
        // Complete this function

        if (isPalindrome(s, -1)) return -1;

        for (int i = 0; i < s.length(); i++) {
            if (s.charAt(i)!= s.charAt(s.length()-1-i)) {
                if (isPalindrome(s, i))
                    return i;
                 else if (isPalindrome(s, s.length()-1-i))
                    return s.length()-1-i;
                 else
                     throw new RuntimeException("not possible to convert to palindrome");
            }
        }

        throw new RuntimeException("not possible to convert to palindrome"); // we should not reach here.
    }

    static boolean isPalindrome(String p, int k) {
        int s = 0;
        int e = p.length() - 1;
        while ( s < p.length() / 2) {
            if (s == k) {
                s++;
            } else if (e == k) {
                e--;
            }
            if (p.charAt(s) != p.charAt(e)) {
                return false;
            }
            s++;
            e--;
        }
        return true;
    }

}
